import React from 'react'
import { Space, Table, Tag } from 'antd'

export default function table(){
    const columns = [
        {
          title: 'Name',
          dataIndex: 'name',
          key: 'name',
          render: (text) => <a>{text}</a>,
        },
        {
          title: 'Age',
          dataIndex: 'age',
          key: 'age',
        },
        {
          title: 'Address',
          dataIndex: 'address',
          key: 'address',
        }
    ];
    const data = [
        {
          key: '1',
          name: 'John Brown',
          age: 32,
        //   address: 'New York No. 1 Lake Park',
        //   tags: ['nice', 'developer'],
        },
        {
          key: '2',
          name: 'Jim Green',
          age: 42,
        //   address: 'London No. 1 Lake Park',
        //   tags: ['loser'],
        },
        {
          key: '3',
          name: 'Joe Black',
          age: 32,
        //   address: 'Sidney No. 1 Lake Park',
        //   tags: ['cool', 'teacher'],
        },
      ];
  return (
    <div>
    <Table columns={columns} dataSource={data} />;
    </div>
  )
}
